import React from 'react';
import './About.scss';
import food from '../../../src/images/aboutimg.jpg';

const About = () => {
    return (
        <div>
            <div id="about_title">
                <h1>ABOUT:</h1>
            </div>
            <div id = "image_holder">
                <img id = "dessert" style = "float:left"src = {food}/>
            </div>
            <div id = "about">
                <p>This is a recipe app for all the dessert lovers, which allows our users to view and also create recipes.</p>
            </div>
        </div>
    );
}

export default About;
